package Guvi_IP_OP;

import java.util.Scanner;

public class Guvi6_Ip_Op {

	/*
	 * // Write a code to get the input in the given format and print the output in
	 * the given format
	 * 
	 * Input Description: First-line indicates two integers separated by space.
	 * Second-line indicates three integers separated by space. Third-line indicates
	 * three integers separated by space
	 * 
	 * Output Description: Print the input in the same format.
	 * 
	 * Sample Input : 2 5 2 5 6 2 4 5 Sample Output : 2 5 2 5 6 2 4 5
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		String a = sc.nextLine();
		String b = sc.nextLine();
		String c = sc.nextLine();
		System.out.println(a);
		System.out.println(b);
		System.out.println(c);
		sc.close();
	}
}
